import Tandavital from '../igd/triase/component/tandavital';

const Rekammedis = () => {
  return (

<div class="h-full">
	<div class="flex ...">
		<div class="flex-none">
			<Sidebar />
		</div>
  
  		<div class="flex-auto   bg-dasar border-l-2 border-opacity-30 border-gray-300 shadow-md">
			<Header/>
			<div class="container mx-auto px-8 py-4">
				<Pasien />
				{/* <Tandavital id={28} /> */}
			</div>
  		</div>
	</div>
</div>
    

  )
}

export default Rekammedis
